import react from 'react'
import BaseLayout from './BaseLayout'

const ContentLayout = (props) => {
    return (
        <BaseLayout>
            <section className='contentSection'>
                {props.children}
            </section>
        </BaseLayout>
    )
}

export default ContentLayout;
